import Navbar from "./Navbar"
import Head from 'next/head'
import './bootstrap.min.css'


const Layout = (props) => {
  return (
    <div>
        <Head>
            <title>MyNextAPp</title>
        </Head>

    <Navbar />

    {props.children}

    </div>
  )
}

export default Layout
